import React, { useState, useEffect } from 'react';
import { Container } from 'react-bootstrap';
import { Row } from 'react-bootstrap';
import { Col } from 'react-bootstrap';
import { FaBars } from "react-icons/fa";

const Navbar  = () => {
    return (
       <header>
                <Container fluid className="nav">
                    <Row className="nav-row" fluid>
                        <Col>
                            <Logo /> 
                        </Col>
                        <Col>   
                            <Navigation />
                        </Col>
                    </Row>
                </Container>    
                <Stage />
       </header>
    )
}

const Navigation = () => {
return (
    <ul className="navigation-parent">
        <li className="nav-element" id="ueber">Über Uns</li>
        <li className="nav-element" id="mitgliedschaft">Mitgliedschaft</li>
        <li className="nav-element" id="anfahrt">Anfahrt</li>
        <li className="nav-element" id="liga">Liga</li>
        <li className="nav-element" id="kontakt">Kontakt</li>
    </ul>
);
}

const Logo = () => {
return (
    <a className="logo-container ">
        <img className="img-fluid" src="././img/DFGP_Logo_nav.png" alt="DFGP Logo"></img>
    </a>
);
}

const Stage = () => {
return (
    <img className="img-fluid" src="././img/Teamfoto_buehne.jpg" alt="DFGP Team Foto vom ersten Spieltag"></img>
);
}

const Hamburger = () => {
    return (

<div class="topnav">
  
  <div id="myLinks">
    <a href="#ueber">Über Uns</a>
    <a href="#mitgliedschaft">Mitgliedschaft</a>
    <a href="#anfahrt">Anfahrt</a>
    <a href="#liga">Liga</a>
    <a href="#kontakt">Kontakt</a>
  </div>
  
  <a href="javascript:void(0);" class="icon" onclick="myFunction()">
    <FaBars />
  </a>
</div>
    )
}

export default Navbar;
